Adventures in Your Own Backyard is the fourth studio album by Canadian musician Patrick Watson, released in April 2012. It is the band's follow-up to the Polaris Music Prize-nominated 2009 release Wooden Arms, but by comparison is a musically simpler and more emotional album. The songs of Adventures in Your Own Backyard are described as "boisterous and pretty, alive and roaming, fairytales with Watson’s skimming falsetto", and continue in the band's signature style of cinematic and orchestral pop. Like the band's previous release, Wooden Arms, the album contains a few unusual instruments, including a glass marimba on one track, but in general features less of the experimental sound, opting instead for "an eloquent, perhaps deceptive, simplicity" and more mature production. Writing for The Globe and Mail, music critic Brad Wheeler noted the band's stylistic changes, calling Adventures in Your Own Backyard "a dreamy bath of chamber-pop and fancy cabaret, less clacky without the kitchen-utensil or bike-wheel percussion of Wooden Arms and slightly more grounded than Close to Paradise". Thematically, the album was inspired by the concept of home, and especially the 

